const {tree, depth} = data;
let i = 0;
function next(path, node) {
  if (depth && path.length === depth) {
    outputs.path(path, `${tag}:${i}`);
    outputs.node(node, `${tag}:${i}`);
    i++;
  } else if (node instanceof Array) {
    for (let i=0, {length} = node; i<length; i++) {
      next([...path, i], node[i]);
    }
  } else if (node instanceof Object) {
    for (const key in node) {
      next([...path, key], node[key]);
    }
  } else {
    outputs.path(path, `${tag}:${i}`);
    outputs.node(node, `${tag}:${i}`);
    i++;
  }
}
next([], tree);
outputs.done(null, tag);
